import Userlist from './userlist'
import Adduser from './adduser'

function App() {
  return (
    <div className="App">
      My React + Express App
      <button className="text-3xl font-bold underline">Test Tailwind</button>
      <Userlist />
      <Adduser />
    </div>
  );
} 

export default App;
